import React from "react";
import ContactService from "./api/ContactService";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <h1>Main Page</h1>
      <ul>
        <li><Link to="/signup">Sign Up</Link></li>
        <li><Link to="/signin">Sign In</Link></li>
        <li><Link to="/f">Link to F</Link></li>
      </ul>

      <Routes>
        <Route path="/signup" element={<ContactService />} />
        <Route path="/e" element={<ContactService />} />
        <Route path="/f" element={<ContactService />} />
      </Routes>
    </Router>
  );
}

export default App;
